import img from "./icons8-moon-50.png";
import img2 from "./icons8-moon-50 (1).png";
import { useState } from "react";

function DarkTheme() {
    const [lightMode, setLightMode] = useState(false);
    const handleChangeDarkTheme = () => {
        setLightMode(prevMode => !prevMode)
    }
  return (
    <div>
      <div className="header-span">
        <img
          onClick={handleChangeDarkTheme}
          alt="darkmode"
          width="20px"
          src={lightMode? img : img2}
        />
        <span className="icon-light material-symbols-outlined">dark_mode</span>
        <p className="font-semibold">Dark Mode</p>
      </div>
    </div>
  );
}
export default DarkTheme;
